import React from "react";
import {
  Text,
  Flex,
  Box,
  VStack,
  HStack,
  Icon,
  Badge,
  Spacer,
  Link,
  Drawer,
  Divider,
} from "native-base";
import {
  DrawerContentScrollView,
  DrawerItem,
  DrawerItemList,
} from "@react-navigation/drawer";
import { OrdersBag } from "@src/../assets/IconComponents/OrdersBag";
import { Profile } from "@src/../assets/IconComponents/Profile";

const DrawerContent = (props) => {
  return (
    <Box flex={1}>
      <DrawerContentScrollView {...props}>
        <HStack>
          <Icon />
        </HStack>
        <DrawerItem
          icon={({ focused }) => {
              let stateColor;
        stateColor = focused ? '#FFFF00' : '#FF1B03';
            return (
              <HStack>
               {focused && (<Divider
                  bg="#8F92A1"
                  thickness="5px"
                  height={"30px"}
                  width={"4px"}
                  borderRadius="3px"
                  mr="8px"
                />)}
                <OrdersBag fill={stateColor} />
              </HStack>
            );
          }}
          label="Orders"
          onPress={() => {}}
          labelStyle={{ color: "blue", paddingLeft: "0px" }}
        />
      </DrawerContentScrollView>
    </Box>
  );
};

export default DrawerContent;
